    public function addcategory(Request $req)
    {
        //validation
        $validate = $this->check_validate($req, $this->addValidation);
        if($validate !== "true"){return $validate;}

        //userid
        $user = $this->userInfo($req->usertoken);

        //upload images
        $images = $this->uploadcategoryimage($req->mainimage, $req->images);


        //upload list
        $uploadlist = [
            "title" => $req->title,
            ""
        ];
        //upload category
        $upload = Category::insert($uploadlist);

        return $images;

    }




    private $addValidation = [
        "title" => "required|max:255|min:15",
        "usertoken" => "required",
        "details" => "required|min:50",
        "price" => "required|min:1",
        "salestatus" => "required",
        "salevalue" => "required",
        "prand" => "required|min:1",
        "mainimage" => "required|min:1",
        "images" => "required|min:1",
        "items" => "required|min:1",
        "features" => "required|min:50",
    ];

    private function uploadcategoryimage($main, $branch)
    {
        $imagepath = env("APP_URL") . "/";
        $mainpath = $imagepath . env("maincategorypath") . "/";
        $branchpath = $imagepath . env("branchcategorypath") . "/";
        $images = [];
        $mainimage =  $mainpath . $this->Uploadfile($main, env("maincategorypath"), Str::random(4));
        foreach($branch as $d){
            $images[] = $branchpath . $this->Uploadfile($d, env("branchcategorypath"), Str::random(4));
        }

        $images_data = [
            "main" => $mainimage,
            "branches" => $images,
        ];
        return $this->makeJson($images_data);
    }

